import React from 'react';
import { View, Button, StyleSheet } from 'react-native';
import { StackNavigationProp } from '@react-navigation/stack';

export type RootStackParamList = {
  RoleGate: undefined;
  CustomerHome: undefined;
  BarberDashboard: undefined;
};

type Props = {
  navigation: StackNavigationProp<RootStackParamList, 'RoleGate'>;
};

export default function RoleGate({ navigation }: Props) {
  return (
    <View style={styles.container}>
      <Button title="I'm a Customer" onPress={() => navigation.replace('CustomerHome')} />
      <Button title="I'm a Barber" onPress={() => navigation.replace('BarberDashboard')} />
    </View>
  );
}

const styles = StyleSheet.create({
  container: { flex: 1, justifyContent: 'center', gap: 12, padding: 24 },
});
